Sharing a poem I wrote in 2021 after the Massacre in Sheikh Jarrah. 

12/05/2021
Poem for Sheikh Jarra, Palestine 

*My tears keep flowing*

My tears keep flowing;
The years this has been going.
The media fake reporting:
The reality, whats really happening;

50 years of occupation and killing. Palestinians will not stop resisting, even while they are bleeding. 

The bombs keep dropping;
With no remorse or humamity showing.

Yet despite all the efforts, each bomb that drops;
Will not kill the resistence till the occupation stops.

